import { CUSTOM_ELEMENTS_SCHEMA, Component, inject } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterOutlet } from '@angular/router';
import { OutlinedTextFieldComponent } from './shared/components/outlined-text-field/outlined-text-field.component';
import { FormBuilder, FormGroup, ReactiveFormsModule, Validators } from '@angular/forms';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [CommonModule, RouterOutlet, OutlinedTextFieldComponent, ReactiveFormsModule],
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class AppComponent {
  title = 'MicroManager';

  fb: FormBuilder = inject(FormBuilder);
  form: FormGroup = this.fb.group({
    firstname: ['', Validators.required],
  })

  constructor() {
    this.form.valueChanges.subscribe((value) => console.log(value));
    this.form.controls['firstname'].disable();

    setTimeout(() => this.form.controls['firstname'].enable(), 5000)
  }

}

import { Component, ElementRef, ViewChild, signal, effect, computed, WritableSignal, Input } from '@angular/core';
import { ControlValueAccessor } from '@angular/forms';

export type TextFieldState =
  | 'unfocused'
  | 'hovered'
  | 'focused'
  | 'error'
  | 'disabled';

  @Component({
    selector: 'generic-text-input',
    template: '',
  })
  export class BaseTextFieldComponent implements ControlValueAccessor {
    @Input() placeholder: string = '';
    @Input() error?: string;
    @ViewChild('input') input?: ElementRef<HTMLInputElement>;

    // signals
    state: WritableSignal<TextFieldState> = signal('unfocused');
    populated = signal(false);
    classList = computed(
      () => `${this.state()} ${this.populated() ? 'populated' : 'unpopulated'}`
    );

    // value accessor
    onChange = (value: any) => {};
    onTouched = () => {};
    touched = false;
    initialvalue?: string;

    ngAfterViewInit() {
      const el: HTMLInputElement | undefined = this.input?.nativeElement;
      el?.addEventListener('input', () => {
        this.onChange(el.value);
        this.populated.set(el.value.length > 0 || this.placeholder.length > 0);
      });

      if (el && this.initialvalue) el.value = this.initialvalue;
    }

    ngOnChanges() {
      if (this.error) this.state.set('error');
      console.log(this.error);
      if (this.placeholder.length > 0) this.populated.set(true);
    }

    //#region Value Accessor
    writeValue(obj: any): void {
      const el = this.input?.nativeElement;
      if (el) {
        el.value = obj;
      } else {
        this.initialvalue = obj;
      }
    }

    registerOnChange(fn: any): void {
      this.onChange = fn;
    }

    registerOnTouched(fn: any): void {
      this.onTouched = fn;
    }

    markAsTouched() {
      if (!this.touched) {
        this.touched = true;
        this.onTouched();
      }
    }

    setDisabledState(disabled: boolean) {
      if(disabled) {
        this.onDisable();
      } else {
        this.onEnable();
      }
    }
    //#endregion

    //#region State Reducers
    onFocus() {
      this.state.update((state) => {
        if (state === 'unfocused' || state === 'hovered') {
          return 'focused';
        }
        return state;
      });
    }

    onBlur() {
      this.state.update((state) => {
        if (state === 'focused') {
          return 'unfocused';
        }
        return state;
      });
    }

    onMouseOver() {
      this.state.update((state) => {
        if (state === 'unfocused') {
          return 'hovered';
        }
        return state;
      });
    }

    onMouseOut() {
      this.state.update((state) => (state === 'hovered' ? 'unfocused' : state));
    }

    onDisable() {
      this.state.set('disabled');
    }

    onEnable() {
      this.state.update(state => {
        if(state === 'disabled') {
          return this.error ? 'error' : 'unfocused';
        } else {
          return state;
        }
      });
    }
    //#endregion
  }

